import rewire from "rewire"
import { inputToDefinition } from "./typescript"

import { Introspection, SchemaType } from "./interface"

let inputDefinition
const schema = require("../test/github.json")
const typescript = rewire("./typescript")
const beginComment = typescript.__get__("beginComment")
const toComment = typescript.__get__("toComment")
const endComment = typescript.__get__("endComment")
const utilDefinition = typescript.__get__("utilDefinition")
const responseDefinition = typescript.__get__("responseDefinition")
const refToDefinition = typescript.__get__("refToDefinition")
const descriptionToComment = typescript.__get__("descriptionToComment")
const scalarToDefinition = typescript.__get__("scalarToDefinition")
const ReadableFromQueue = typescript.__get__("ReadableFromQueue")
schema.data.__schema.types.forEach((type) => {
    switch (type.name) {
        case 'AddCommentInput':
            inputDefinition = type;
            break;
        default:
            return null;
    }
});

const inputExpected = `/**
 * Autogenerated input type of AddComment
 */
export interface AddCommentInput {

    /**
     * A unique identifier for the client performing the mutation.
     */
    clientMutationId?: Optional<String>;

    /**
     * The Node ID of the subject to modify.
     */
    subjectId: NonNull<ID>;

    /**
     * The contents of the comment.
     */
    body: NonNull<String>;
}`

test('Generate ' + inputDefinition.kind + ' definition', () => {
    expect(inputToDefinition(inputDefinition))
        .toBe(inputExpected);
});

